script: |
  super -f text -I q4559.spq | sort > q4559.out

inputs:
  - name: q4559.spq
    data: |
      SELECT - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 92 * + col2 * + 29 * + 75 BETWEEN + ( - + col0 ) AND ( + col2 );
  - name: tab2

outputs:
  - name: q4559.out
    data: |
      -46
      -64
      -75
